script: |
  super -f text -I q2884.spq | sort > q2884.out

inputs:
  - name: q2884.spq
    data: |
      SELECT - col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE + ( col0 ) * - + col2 NOT BETWEEN + 68 + - + 51 - - - col1 AND + 5;
  - name: tab2

outputs:
  - name: q2884.out
    data: |
      -46
      -64
      -75
